import './App.css';
import React from 'react'
import axios from 'axios'

let data = axios.get('http://localhost:4000/')
  .then(function (response) {
    // handle success
    return response.data
  })
  .catch(function (error) {
    // handle error
    console.log(error);
  })

const list = []

data.then(function (data) {

  list.name = data.name
  list.rating = data.rating
  list.summary = data.summary

})

class App extends React.Component {
  constructor(props) {
    super(props)
    this.state = {
      list: list,
    }
  }

  render() {
    return (
      <div>
        {this.state.list.map(item => 
          <div className="App">
            <h1>{item.name}</h1>
          </div>
        )}

      </div>
    );
  }
}

export default App;
